import React from 'react';

class ShipmentTable extends React.Component {
    tdata = [];
    tcolumns = [
        {
            Header: 'ID',
            accessor: 'id'
        },
        {
            Header: 'Name',
            accessor: 'name'
        }
    ] ; 
    constructor(props){
        super(props);
        this.state = {
            ship_data : this.props.ship_data
        }
    }

    componentWillReceiveProps(){
        this.setState({ ship_data : this.props.ship_data});
    }

    componentDidMount(){

    }

    shouldComponentUpdate(){

    }

    render(){
        if(!this.state.ship_data.length)
        return null;
        else {
            console.log(this.state.ship_data);
            return (
                <>
                <div>Shipment Table</div>
                <table>
                    <tr>
                    <thead>ID</thead>
                    <thead>Name</thead>
                    <thead>Mode</thead>
                    <thead>Type</thead>
                    <thead>Origin</thead>
                    <thead>Destination</thead>
                    </tr>
                {this.state.ship_data.map((d , index) => {
                   if(d != undefined && d != null){
                       return(
                               <tr key={index}>
                                   <td>{d.id}</td>
                                   <td>{d.name}</td>
                                   <td>{d.mode}</td>
                                   <td>{d.type}</td>
                                   <td>{d.origin}</td>
                                   <td>{d.destination}</td>
                               </tr>
                       )
                    }
                })}
                </table>
                </>
            )
        }

    }
}

export default ShipmentTable;
